import React, {Component} from 'react';
import './Nav.css';
class Category extends Component {
  render() {
    let onClickCategoryExtend = (e) => {
      document.getElementById('Category-sub-1').style.display = 'flex';
      }

    let onClickCategoryShort = (e) => {
      document.getElementById('Category-sub-1').style.display = 'none';
    }
    var category = null;
    if(this.props.Category.subCategory!==undefined) {
      category = 
        <div className="Category">
          <div id="Category-main-1" className="Category-main">
          <button className="Category-button" onClick={onClickCategoryExtend}>▼</button>
            <div className="Categoty-content">Category</div>
          </div>
          <div id="Category-sub-1" className="Category-sub">
          <button id="" className="Category-button" onClick={onClickCategoryShort}>▲</button>
             <div className="Categoty-content">Category</div>
          </div>
         
        </div> 
    }

    return(
      <li className="Nav-category-item">
        {category}
      </li>
    )
  }
}

export default class Nav extends Component {
    render() {
      let category = {
        subCategory: 'subCategory'
      };
      return(
        <div className="Nav">
          <div className="Nav-category-tab">category</div>
          <ul className="Nav-category-items">
              <Category Category={category}></Category>
          </ul>
          <p className="Nav-category-foot">foot</p>
        </div>
      )
    }
  }
